import React from 'react';
import NumberButton from '../ButtonComponents/NumberButton';
import OperatorButton from '../ButtonComponents/OperatorButton';
import ClearButton from '../ButtonComponents/ClearButton';
import ZeroButton from '../ButtonComponents/ZeroButton';
import './Display.css';

const numbers = [7, 8, 9, 4, 5, 6, 1, 2, 3];
const operators = ['/', 'x', '-', '+', '='];

function CalculatorDisplay() {
  // will house the topmost results of caculations
  return (
    <div>
      <div className="col-md-6">
        <div className="col bg-dark text-white col-height border justify-content-end d-flex align-items-center zero">
          <ZeroButton />
        </div>

        <div className="row">


        </div>


        {numbers.map(numberFromMap => (
          <NumberButton number={numberFromMap} key={numberFromMap} />
        ))}

        {/* Final col-md-6 div */}
      </div>
      {/* Final div */}
    </div>
  );
}

export default CalculatorDisplay;

